/*
 * Copy canvas image from one excercise. Image is stored in localStorage, if localStorage key is not set a GFA logo is used to be displayed
 */
function drawCanvas(canvasId, storageKey) {
  let myCanvas = document.getElementById(canvasId);
  let ctx = myCanvas.getContext("2d");

  let img = new Image();
  img.onload = function () {
    ctx.drawImage(img, 0, 0, 300, 150);
  };

  if (localStorage.getItem(storageKey) == null) {
    img.src =
      "data:image/png;base64,";
  } else {
    img.src = localStorage.getItem(storageKey);
  }
}

function loadAndDrawImage(canvasId, url) {
  let myCanvas = document.getElementById(canvasId);
  let ctx = myCanvas.getContext("2d");

  let img = new Image();
  img.onload = function () {
    ctx.drawImage(img, 50, 50, 300, 150);
  };

  img.src = url;
}

function resizeImg(imgId) {
  let canvas = document.querySelector("canvas");
  let img = document.getElementById(imgId);
  if (img && img.style) {
    img.style.width = canvas.offsetWidth + "px";
    img.style.height = canvas.offsetHeight + "px";
  }
}

